  summary: >-
    Represents an interface for a bounding box defined by top-right and bottom-left coordinates.

    This interface extends the <xref href="Pelias.NET.Model.Interfaces.IEntity" data-throw-if-not-resolved="false"></xref> interface and implements <xref href="System.Collections.Generic.IEnumerable%601" data-throw-if-not-resolved="false"></xref>.
  example: []
  syntax:
    content: 'public interface IBoundingBox<TCoordinates, TAngle> : IEntity, IEnumerable<TCoordinates>, IEnumerable where TCoordinates : ICoordinates<TAngle> where TAngle : IAngle'
    typeParameters:
    - id: TCoordinates
      description: The type representing the coordinates of the bounding box, which must implement <xref href="Pelias.NET.Model.Interfaces.GeographicInformationSystems.ICoordinates%601" data-throw-if-not-resolved="false"></xref>.
    - id: TAngle
      description: The type representing an angle measurement, which must implement <xref href="Pelias.NET.Model.Interfaces.GeographicInformationSystems.Measurements.Measures.IAngle" data-throw-if-not-resolved="false"></xref>.
    content.vb: Public Interface IBoundingBox(Of TCoordinates As ICoordinates(Of TAngle), TAngle As IAngle) Inherits IEntity, IEnumerable(Of TCoordinates), IEnumerable
