  assemblies:
  - Pelias.NET
  namespace: Pelias.NET.Model.Interfaces.GeographicInformationSystems
  summary: Checks whether the specified coordinates are within the bounding box.
  remarks: >-
    This method checks if both the latitude and longitude of the specified coordinates 

    are within the ranges defined by the top-right and bottom-left coordinates of the bounding box.
  example: []
  syntax:
    content: bool Contains(TCoordinates coordinates)
    parameters:
    - id: coordinates
      type: '{TCoordinates}'
      description: The coordinates to check, represented as a <code class="typeparamref">TCoordinates</code> instance.
    return:
      type: System.Boolean
      description: <code>true</code> if the coordinates are within the bounds of the bounding box, otherwise <code>false</code>.
    content.vb: Function Contains(coordinates As TCoordinates) As Boolean
